import React, { Suspense } from "react";
import GeneratePostmanCollection from "./api-validator/GeneratePostmanCollection";
import RunPostmanCollection from "./api-validator/RunPostmanCollection";
const Upload = React.lazy(() => import("./upload/Upload"));
const About = React.lazy(() => import("./about/About"));
const Export = React.lazy(() => import("./export/Export"));
const Header = React.lazy(() => import("./header/Header"));
const Server = React.lazy(() => import("./server-tab/ServerTab"));
const ApiValidator = React.lazy(() => import("./api-validator/ApiValidator"));
const Main = React.lazy(() => import("./main/Main"));
const Schemas = React.lazy(() => import("./schemas/Schemas"));
const Tags = React.lazy(() => import("./tags/Tags"));

const SelectionTab = ({ selected }) => {
  const obj = {
    home: <About />,
    upload: <Upload />,
    header: <Header />,
    servers: <Server />,
    exports: <Export />,
    apiValidator: <ApiValidator />,
    main: <Main />,
    tags: <Tags />,
    schemas: <Schemas />,
    testBuilder: <GeneratePostmanCollection />,
    testExecutor: <RunPostmanCollection />,
  };
  const selectedComponent = obj[selected];

  return (
    <div>
      <Suspense fallback={<div>Loading...</div>}>{selectedComponent}</Suspense>
    </div>
  );
};
export default SelectionTab;
